import React, { Component } from 'react';
import "./Test.css"

const GridElement = (key) => {
    return(
        <div
            className={"grid-element"}
            key={key}
            onDragOver={onDragOver}
            onDrop={onDrop}>
        </div>);
}

function onDragOver(ev) { ev.preventDefault(); };
function onDragStart(ev, id) { ev.dataTransfer.setData("id", id); };
function onDrop(ev, position) {
    let id = ev.dataTransfer.getData("id");
}

export default class Test extends Component {
    render_GridElements(x) {
        let gridelements = [];
        for (let i=0; i < x; i++) {
            gridelements.push(
                GridElement("GridElement" + i)
            );
        }
        return gridelements;
    }

    render_Rectangles(x) {
        let rectangles = [];
        for (let i = 0; i < x; i++) {
            rectangles.push(
                <div className={"rectangle"}>{i}</div>
            );
        }
    }

    render() {
        return(
            <div className={"Test"}>
                <div className={"grid"}>
                    {this.render_GridElements(9)}
                </div>
                <div className={"start-area-container"}>
                    <div className={"start-area"}></div>
                    <div className={"start-area-button"}>
                        <p className={"button-font"}>
                            ELEMENT++
                        </p>
                    </div>
                </div>
            </div>
        );
    }
}
